import React, { useEffect, useState } from 'react'
import { useParams } from 'react-router-dom';
import {Link} from "react-router-dom"
import Header from '../components/Header'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import {faArrowLeft,faPrint} from '@fortawesome/free-solid-svg-icons'
import axios from 'axios'


function Show() {

  const [data,setData] = useState([]);
  const {id} = useParams();

  useEffect(()=>{
    const fetchData = async ()=>{
      try {

        const res = await axios.get("http://localhost:5000/show/"+id)
        // console.log(res.data)
        setData(res.data)
        
      } catch (error) {
        console.log(error);
      }
    }
    
    fetchData();
  },[])

  const handlePrint = ()=>{
      window.print();
  }

  return (
    <div className='container'>
      <Header />
      <Link to={'/'} className='btn btn-sm btn-primary' ><FontAwesomeIcon icon={faArrowLeft} /> Retour</Link>
      <button onClick={handlePrint} className='btn btn-sm btn-secondary'><FontAwesomeIcon icon={faPrint} /> Imprimer</button>
      <h3 className='my-2'>Plus d'informations :</h3>
      <hr />
      <table className="table table-striped table-hover" my-5>
        
          {
            data.map((item,index) =>(
              <tbody>
                <tr>
                  <th>Axe :</th>
                  <td>{item.nom_axe}</td>
                </tr>
                <tr>
                  <th>Etablissement :</th>
                  <td>{item.nom_etab}</td>
                </tr>
                <tr>
                  <th>Address :</th>
                  <td>{item.adresse}</td>
                </tr>
                <tr>
                  <th>Téléphone :</th>
                  <td>{item.telephone}</td>
                </tr>
                <tr>
                  <th>Nom de projet :</th>
                  <td>{item.nom_projet}</td>
                </tr>
                <tr>
                  <th>Module :</th>
                  <td>{item.module}</td>
                </tr>
                <tr>
                  <th>Date Début :</th>
                  <td>{item.date_debut}</td>
                </tr>
                <tr>
                  <th>Date Fin :</th>
                  <td>{item.date_fin}</td>
                </tr>
                <tr>
                  <th>Status :</th>
                  <td>{item.status}</td>
                </tr>
                                
             </tbody>
            ))
          }

      </table>
      

    </div>
  )
}

export default Show
